import Button from "../component/Button";
import Header from "../component/Header";

const Home = () => {
    return (
        <div>
            <Header 
                titile = {"Home"}
                leftChild={
                    <Button
                        type="positive"
                        text={"긍정 버튼"}
                        onClick={()=>{
                            alert("po button");
                        }}
                    />
                }
            />
            <Button
                text={"기본"}
                onClick = {() => {
                    alert("default button");
                }}
             />
             <Button
                type="positive"
                text={"긍정"}
                onClick = {() => {
                    alert("po button");
                }}
             />
             <Button
                type="negative"
                text={"부정"}
                onClick = {() => {
                    alert("ne button");
                }}
             />
        </div>
    );
        
};

export default Home;
